import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import MenuBar from '../components/MenuBar';
import '../css/profile.css';
import '../css/index.css';
import defaultProfilePic from '../images/default-profile-pic.jpg'; // Import the image

const Profile = () => {
    const [username, setUsername] = useState('');
    const [videos, setVideos] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchProfileData = async () => {
            try {
                const token = localStorage.getItem('token');
                const res = await axios.get('http://localhost:5001/api/videos/user', {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });
                setUsername(res.data.username);
                setVideos(res.data.videos);
            } catch (error) {
                console.error('Error fetching profile data:', error);
            }
        };

        fetchProfileData();
    }, []);

    const handleLogout = () => {
        localStorage.removeItem('token'); // Remove the token from localStorage
        navigate('/login'); // Redirect to the login page
    };

    return (
        <div className="profile">
            <div className="inner-profile-container">
                <div className="profile-header">
                    <div className="profile-image">
                        <img src={defaultProfilePic} className="profile-header-pic" alt="Profile" />
                    </div>
                    <h1>@{username}</h1>
                    <button className="logout-button" onClick={handleLogout}>
                        Log Out
                    </button>
                </div>
                <div className="video-grid">
                    {videos.map((video) => (
                        <div key={video.id} className="video-grid-item">
                            <img
                                src={`http://localhost:5001${video.thumbnail}`}
                                alt={video.title}
                                className="video-thumbnail"
                            />
                        </div>
                    ))}
                </div>
            </div>
            <MenuBar />
        </div>
    );
};

export default Profile;
